                    item.Registros = this;
                }
            }

            if (e.OldItems != null)
            {
                foreach (SociedadesRegistros item in e.OldItems)
                {
                    if (ReferenceEquals(item.Registros, this))
                    {
                        item.Registros = null;
                    }
                }
            }
        }

        #endregion

    }
}
